import React from "react";
import Particles from "react-particles-js";
import { Container, Row } from "react-grid-system";

class parts extends React.Component {
  render() {
    return (
      <div>
        <Particles
          height="100vh"
          style={{
            opacity: "0.8",
            position: "fixed",
            left: "0",
            top: "0",
            zIndex: "-1"
          }}
          params={{
            particles: {
              number: {
                value: 50
              },
              move: {
                direction: "random",
                speed: 2
              },
              size: {
                value: 3
              }
            },
            interactivity: {
              events: {
                onhover: {
                  enable: true,
                  mode: "repulse"
                }
              }
            }
          }}
        />
        <div style={{ position: "fixed", top: "0", left: "0" }}>
          <Container>
            <Row>
              <Col xs={12} sm={10} md={8}></Col>
            </Row>
          </Container>
          <h1>Hi i Paridhi</h1>
        </div>
      </div>
    );
  }
}

export default parts;
